sources.styles/utils/_mixins.scss:
@mixin hover($_property, $_toValue) {
  transition: #{$_property} 0.3s;
  &:hover {
    #{$_property}: $_toValue;
  }
}

@mixin smartphone {
  @media (min-width: 640px) {
    @content;
  }
}

@mixin smalldesktop {
  @media (min-width: 1280px) {
    @content;
  }
}

@mixin gridPage {
  --columns: 2;
  display: grid;
  column-gap: 20px;
  grid-template-columns: repeat(var(--columns), 1fr);

  @include  smartphone {
    --columns: 6;
    column-gap: 30px;
  }

  @include smalldesktop {
    --columns: 12;
    column-gap: 30px;
  }
}

sources.styles/blocks/header.scss:
.header {
  background: linear-gradient(135deg, #191536 0%, #000 100%);
  width: 100%;

  &__content {
    padding-top: 20px;
    padding-bottom: 33px;

    @include smartphone {
      @include gridPage;
      padding-top: 30px;
      padding-bottom: 70px;
    }

    @include smalldesktop {
      padding-bottom: 100px;
    }
  }

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 14px;

    @include smartphone {
      grid-column: 1 / -1;
      margin-bottom: 55px;
    }

    @include smalldesktop {
      margin-bottom: 116px;
    }
  }

  &__left {
    display: flex;
    flex-direction: row;
    align-items: center;
    gap: 34px;
  }

  &__lg {
    @include hover(transform, scale(1.2));

    @include smalldesktop {
      width: 77px;
      height: 16px;
    }
  }

  &__language {
    display: none;

    @include smalldesktop {
      display: flex;

      color: $color-lait-blue;
      font-style: normal;
      font-weight: 500;
      font-size: 14px;
      line-height: 100%;
      appearance: none;
      position: relative;
      cursor: pointer;
      padding: 0 10px;
      background: url("../images/header-icon-down.svg") no-repeat;
      background-position: right 65%;
      height: 18px;
      border: none;
    }

    &:focus-visible {
      outline: none;
    }
  }

  &__right {
    display: flex;
    flex-direction: row;
    align-items: center;
  }

  &__icon {
    @include hover(transform, scale(1.2));

    @include smalldesktop {
      display: none;
    }
  }

  &__menu {
    display: none;

    @include smalldesktop {
      display: flex;
    }
  }

  &__list {
    display: flex;
    flex-direction: row;
    width: auto;
    gap: 35px;
    margin: auto;
  }

  &__item {
    padding-left: 0;
  }

  &__link {
    color: $color-white;
    font-family: $font-family;
    font-size: 16px;
    font-style: normal;
    font-weight: 500;
    line-height: 130%;
    cursor: pointer;
    transition: 0.5s;

    &:hover {
      color: $color-lait-blue;
    }

  }

  &__button {
    width: 200px;
    height: 48px;
    color: $color-white;
    text-align: center;
    font-family: $font-family;
    font-size: 16px;
    font-style: normal;
    font-weight: 500;
    line-height: 130%;

    border-radius: 4px;
    background: $color-blue;
    margin-left: 35px;
    cursor: pointer;
    transition: 0.5s all;

    &:hover {
      background-color: $color-white;
      color: $color-blue;
      border: 3px solid $color-blue;
      font-weight: 900;
    }
  }

  &__photo {
    grid-column: 4 / -1;
    grid-row: 2;
    margin: auto;

    @include smalldesktop {
      grid-column: 5 / -1;
    }
  }

  &__img {
    width: 100%;
  }

  &__main {
    grid-column: 1 / 4;
    grid-row: 2;

    @include smalldesktop {
      grid-column: 1 / 7;
    }
  }

  &__title {
    color: $color-white;
    font-family: $font-family;
    font-size: 26px;
    font-style: normal;
    font-weight: 900;
    line-height: 130%;
    margin-bottom: 17px;

    @include smalldesktop {
      font-size: 46px;
      margin-bottom: 17px;
    }
  }

  &__span {
    color: $color-blue;
    font-weight: 200;
  }

  &__subtitle {
    margin-bottom: 8px;

    @include smalldesktop {
      max-width: 336px;
      margin-left: 100px;
    }
  }

  &__description {
    color: $c0lor-grey;
    font-family: $font-family;
    font-size: 16px;
    font-style: normal;
    font-weight: 500;
    line-height: 150%;

    @include smartphone {
      margin-bottom: 10px;
      font-size: 14px;
    }

    @include smalldesktop {
      margin-bottom: 5px;
    }
  }

  &__price {
    display: flex;
    justify-content: center;
    color: $color-white;
    font-family: $font-family;
    font-size: 18px;
    font-style: normal;
    font-weight: 500;
    line-height: normal;
    margin-top: 8px;
    margin-bottom: 26px;

    @include smartphone {
      justify-content: left;
      margin-bottom: 23px;
